import React from 'react'
import logo from 'images/logo.svg'
import logo_s from 'images/logo-h.svg'
import logo_w from 'images/logo_w.svg'

export const Banner00DataSource = {
  wrapper: { className: 'banner0 k83fye1ylu-editor_css' },
  textWrapper: { className: 'banner0-text-wrapper' },
  title: {
    className: 'banner0-title',
    children: <img src={logo} alt="" />,
  },
  content: {
    className: 'banner0-content k83hoswqa2m-editor_css',
    children: (
      <span>
        <span>
          <p></p>
          <p>
            <br />
          </p>
        </span>
      </span>
    ),
  },
  button: {
    className: 'banner0-button',
    children: '尋茶',
    href: '/product',
    target: '/product',
    type: 'default',
  },
}
export const Feature00DataSource = {
  wrapper: { className: 'home-page-wrapper content0-wrapper' },
  page: { className: 'home-page content0' },
  OverPack: { playScale: 0.3, className: '' },
  titleWrapper: {
    className: 'title-wrapper',
    children: [
      {
        name: 'title',
        children: (
          <span>
            <p>精選產品</p>
          </span>
        ),
      },
    ],
  },
  childWrapper: {
    className: 'content0-block-wrapper',
    children: [
      {
        name: 'block0',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'https://www.tongluotea.com/tw/uploads/cart/1000/2/157300988622.jpg',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              href: 'Commodity/17',
              children: (
                <span>
                  <span>
                    <p>
                      <b>醇翠綠茶</b>
                    </p>
                  </span>
                </span>
              ),
            },
            {
              name: 'content',
              children: (
                <span>
                  <p>
                    採摘自農林自擁茶園，採以新牙嫩葉製成。條索紮實分明，茶湯清澈碧綠，蓄含鮮活海苔香氣。※本立體茶包網袋、棉線及掛標皆玉米澱粉製成。天然、無毒、環保可分解。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
      {
        name: 'block1',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'https://d.ecimg.tw/items/DBALBFA9009D549/000001_1535569934.jpg',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              href: 'Commodity/12',
              children: (
                <span>
                  <p>
                    <b>嚴選阿薩姆紅茶</b>
                  </p>
                </span>
              ),
            },
            {
              name: 'content',
              children: (
                <span>
                  <p>
                    以印度阿薩姆Jaipuri品系單株選拔育成，承襲原阿薩姆紅茶的特殊香氣，茶湯較台茶十八號濃厚，採自然栽培法，將古典的紅茶香氣培育出甜香餘韻，滋味濃郁甘醇。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
      {
        name: 'block2',
        className: 'content0-block',
        md: 8,
        xs: 24,
        children: {
          className: 'content0-block-item',
          children: [
            {
              name: 'image',
              className: 'content0-block-icon',
              children:
                'http://www.ttch.com.tw/uploadFile/upload/product/ff80808168daede10168db9cbf9d003d.jpg',
            },
            {
              name: 'title',
              className: 'content0-block-title',
              href: 'Commodity/3',
              children: (
                <span>
                  <p>
                    <b>銅鑼-蜜韻紅茶</b>
                  </p>
                </span>
              ),
            },
            {
              name: 'content',
              children: (
                <span>
                  <p>
                    來自產自農林銅鑼茶園，無使用人工添加物、色素、香料，茶菁經小綠葉蟬著涎後，茶質具果蜜香氣。茶湯澄紅明亮，入喉溫潤滑順，餘韻甘甜，耐久泡不苦澀。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
    ],
  },
}
export const Banner01DataSource = {
  wrapper: { className: 'banner0 k83fveagfd-editor_css' },
  textWrapper: { className: 'banner0-text-wrapper' },
  title: {
    className: 'banner0-title',
    children: <img src={logo_w} alt="" />,
  },
  content: {
    className: 'banner0-content',
    children: (
      <span>
        <p>
          <br />
        </p>
      </span>
    ),
  },
  button: {
    className: 'banner0-button',
    children: '茗家精選',
    href: '/Allstore',
    target: '/product',
    type: 'default',
  },
}
export const Teams10DataSource = {
  wrapper: { className: 'home-page-wrapper teams1-wrapper' },
  page: { className: 'home-page teams1' },
  OverPack: { playScale: 0.3, className: '' },
  titleWrapper: {
    className: 'title-wrapper',
    children: [
      {
        name: 'title',
        children: (
          <span>
            <span>
              <p>嚴選店家</p>
            </span>
          </span>
        ),
      },
    ],
  },
  block: {
    className: 'block-wrapper',
    children: [
      {
        name: 'block0',
        className: 'block',
        md: 8,
        xs: 24,
        titleWrapper: {
          children: [
            {
              name: 'image',
              className: 'teams1-image',
              children:
                'https://scontent.ftpe8-4.fna.fbcdn.net/v/t1.0-9/28279817_1727156610655837_6472842013472785328_n.jpg?_nc_cat=102&_nc_sid=85a577&_nc_ohc=2VSWWuZpyTsAX93y5wV&_nc_ht=scontent.ftpe8-4.fna&oh=a65c1812d7cade37981fbdb805f6f163&oe=5EA88893',
            },
            {
              name: 'title',
              className: 'teams1-title',
              href: 'vendor/1/index',
              children: (
                <span>
                  <span>
                    <span>
                      <p>
                        <b>舞鶴茶園- 公主咖啡</b>
                      </p>
                    </span>
                  </span>
                </span>
              ),
            },
            {
              name: 'content',
              className: 'teams1-job',
              children: (
                <span>
                  <span>
                    <p>
                      <b>花蓮好評第一</b>
                    </p>
                  </span>
                </span>
              ),
            },
            {
              name: 'content1',
              className: 'teams1-content',
              children: (
                <span>
                  <p>
                    跟著日光移動的腳步， 隨著山嵐滿布又散去，
                    我們天天看顧著茶樹與咖啡樹的生長。
                    當陽光垂直地灑落在北回歸線上， 別擔心，還有老欉文旦為蔭，
                    呵護著10年有成的咖啡果實慢慢長大。
                  </p>
                  <p>
                    的確，是他們一生風吹日曬、 爬滿皺紋的手， 摘下果實與葉心，
                    但就在這些飽經風霜的栽種者，
                    像面對孩子般的溫柔照護與耐性等待裡， 我們喝到，
                    公主咖啡最溫潤的香氣。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
      {
        name: 'block1',
        className: 'block',
        md: 8,
        xs: 24,
        titleWrapper: {
          children: [
            {
              name: 'image',
              className: 'teams1-image',
              children: 'https://www.yoshantea.com/img/pc/logo.png',
            },
            {
              name: 'title',
              className: 'teams1-title',
              href: 'vendor/9/index',
              children: (
                <span>
                  <span>
                    <span>
                      <p>
                        <b>遊山茶訪</b>
                      </p>
                    </span>
                  </span>
                </span>
              ),
            },
            {
              name: 'content',
              className: 'teams1-job',
              children: (
                <span>
                  <span>
                    <p>
                      <b>獨特的凍頂烏龍茶</b>
                    </p>
                  </span>
                </span>
              ),
            },
            {
              name: 'content1',
              className: 'teams1-content',
              children: (
                <span>
                  <p>
                    烏龍茶作法源於福建，在臺灣臻於完美，其中又以凍頂烏龍茶為最，
                    直到近期高山茶的興起，市場相繼追求烏龍茶的“高山氣”，加上勞動力不足，製茶人於是不再依靠氣候與經驗看茶製茶，
                    而以一套“標準製茶流程與方法”帶過，於是“菁味”被當成“高山氣”。
                  </p>
                  <p>
                    遊山茶訪追求當年凍頂烏龍茶“涼喉、釘甘”的獨特風味，採較成熟的茶菁予以充足的發酵，再適度的烘焙，
                    最終成就烏龍茶“茶那芳入骨，刀削也未揉”令人懷念的風味。這是遊山茶訪所追求製茶工藝的極致。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
      {
        name: 'block2',
        className: 'block',
        md: 8,
        xs: 24,
        titleWrapper: {
          children: [
            {
              name: 'image',
              className: 'teams1-image',
              children: 'https://www.hugosum.com.tw/images/logo.png',
            },
            {
              name: 'title',
              className: 'teams1-title',
              href: 'vendor/4/index',
              children: (
                <span>
                  <span>
                    <span>
                      <p>
                        <b>和菓森林紅茶莊園</b>
                      </p>
                    </span>
                  </span>
                </span>
              ),
            },
            {
              name: 'content',
              className: 'teams1-job',
              children: (
                <span>
                  <p>
                    <b>正宗日月潭紅茶</b>
                  </p>
                </span>
              ),
            },
            {
              name: 'content1',
              className: 'teams1-content',
              children: (
                <span>
                  <p>
                    茶樹的種植方式採用自然友善栽種方式，施用有機肥料、人工除草，每片一芯二葉皆由採茶婆婆們手工採摘。
                  </p>
                  <p>
                    和菓森林主動將每批紅茶送檢，提供SGS檢驗報告給消費者，最新一期檢驗報告請點選最新消息，請您安心品茗。
                  </p>
                </span>
              ),
            },
          ],
        },
      },
    ],
  },
}
export const Banner21DataSource = {
  wrapper: { className: 'banner2' },
  BannerAnim: {
    children: [
      {
        name: 'elem0',
        BannerElement: { className: 'banner-user-elem' },
        page: { className: 'home-page banner2-page' },
        textWrapper: { className: 'banner2-text-wrapper' },
        bg: { className: 'bg bg0' },
        title: {
          className: 'banner2-title',
          children: (
